script: |
  super -f text -I q8744.spq | sort > q8744.out

inputs:
  - name: q8744.spq
    data: |
      SELECT + col2 FROM tab1 (FORMAT parquet) WHERE NOT - 84 + col2 * col0 BETWEEN CAST ( ( - col0 ) AS REAL ) + - col1 AND ( col0 + + 44 );
  - name: tab1

outputs:
  - name: q8744.out
    data: |
      59
      68
      96
